description:
A Roman soldier is trapped behind enemy lines in 117 A.D.

AD 117. The Roman Empire stretches from Egypt to Spain, and East as far as the Black Sea. But in northern Britain, the relentless onslaught of conquest has ground to a halt in face of the guerrilla tactics of an elusive enemy: the savage and terrifying Picts. Quintus Dias, sole survivor of a Pictish raid on a Roman frontier fort, marches north with General Virilus' legendary Ninth Legion, under orders to wipe the Picts from the face of the earth and destroy their leader Gorlacon. But when the legion is ambushed on unfamiliar ground, and Virilus taken captive, Quintus faces a desperate struggle to keep his small platoon alive behind enemy lines...

